import React, { Component } from "react";
import logo1 from "./logo_transparent.png";
import "./header.css";
import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";
import JobPostPage from "../job_post_page/job_post_page";
class AppHeader extends Component {
  render() {
    return (
      <Router>
        <header>
          <Link to="/">
            <div id="logo"></div>
          </Link>
          <div id="post_job">
            <Link id="post_job_btn" to="../job_post_page/job_post_page">
              Post a Job
            </Link>
            <button type="button" name="button">
              Post a Job
            </button>
          </div>
        </header>
      </Router>
    );
  }
}

export default AppHeader;
